        private String[] getLetterArray()
        {
            if (txtGroupLetterFilePath.Text != "")
            {
                if (File.Exists(txtGroupLetterFilePath.Text))
                {
                    TextReader txtReader = new StreamReader(txtGroupLetterFilePath.Text);
                    String strline = txtReader.ReadLine();
                    txtReader.Close();
                    return strline.Split('\t');
                }
                else
                    MessageBox.Show("Invalid File location");
            }
            else
                MessageBox.Show("Group Letter File should be selected");

            return null;
        }
