        private int getNextRow(int row, Excel.Worksheet worksheet1, int maxRow)
        {
            row++;
            //if (row == 124)
            //    MessageBox.Show("");
            if (worksheet1.Cells[row, 1].Value2 != null)
                return row;
            else
            {
                if (row < maxRow)
                    return getNextRow(row, worksheet1, maxRow);
                else
                    return maxRow;
            }

        }

        private bool doSigTest(string p1, string p2)
        {
            for (int i = 0; i < lstOfSigGroup.Count; i++)
            {
                if (lstOfSigGroup[i].Contains(p1) && lstOfSigGroup[i].Contains(p2))
                    return true;
            }
            return false;

        }

        private double ProportionTestPValue(int N1, int N2, double P1, double P2)
        {
            double Numerator, Denominator, p, q, X1, X2, zValue, pValue;

            if (Math.Abs(P1) == 100 && Math.Abs(P2) == 100)
                return 0;
            if (Math.Abs(P1) == 0 || Math.Abs(P2) == 0)
                return 0;


            P1 = P1 / 100;
            P2 = P2 / 100;
            Numerator = P1 - P2;
            p = (P1 * (1 - P1)) / N1;
            q = (P2 * (1 - P2)) / N2;
            Denominator = Math.Sqrt(p + q);
            if (Denominator != 0)
            {
                zValue = Numerator / Denominator;
            }
            else
            {
                zValue = 0;
            }
            return Math.Abs(zValue);
        }

