        private List<List<int>> getListOfListSegment()
        {
            List<List<int>> listlistOfSegment = new List<List<int>>();

            if (txtGroupFile.Text != "")
            {
                if (File.Exists(txtGroupFile.Text))
                {
                    TextReader txtReader = new StreamReader(txtGroupFile.Text);
                    String strline = txtReader.ReadLine();

                    while (strline != null && !strline.Contains("#"))
                    {
                        if (strline.Trim() != "")
                        {
                            List<int> listOfSegment = new List<int>();
                            string[] word = strline.Split(',');
                            for (int i = 0; i < word.Length; i++)
                            {
                                listOfSegment.Add(Convert.ToInt32(word[i]));
                            }

                            listlistOfSegment.Add(listOfSegment);
                        }

                        strline = txtReader.ReadLine();
                    }




                    //************************ Set Group


                    lstOfSigGroup = new List<string>();
                    if (strline != null)
                    {
                        if (strline.Contains("#"))
                        {
                            strline = txtReader.ReadLine();
                            while (strline != null)
                            {
                                if (strline.Trim() != "")
                                {

                                    string[] word = strline.Split(',');
                                    for (int i = 0; i < word.Length; i++)
                                    {
                                        lstOfSigGroup.Add(word[i].Trim());
                                    }

                                }

                                strline = txtReader.ReadLine();
                            }

                        }
                    }
                }
                else
                {
                    MessageBox.Show("Invalid file location");
                }
            }
            else
            {
                MessageBox.Show("Please select group defination file");
            }

            return listlistOfSegment;
        }

